import React from 'react'
import { useSelector } from 'react-redux'

import { selectFlastat } from '../features/Flastat/flastatSlice'
import { selectFelbloc } from '../features/Flebloc/fleblocSlice'
import { selectFLoddic } from '../features/Floddic/floddicSlice'

import Animal from '../components/Animal'

import "../style/Home.css"

function Home() {
  const flastat = Object.values(useSelector(selectFlastat)) ;
  const felbloc = Object.values(useSelector(selectFlebloc));
  const floddic = Object.values(useSelector(selectFLoddic));

  return (
    <main className='main'>
      <div className="box_1" >
        <h1 className="big-text">Adopt Our Pets</h1>
        <h2 className="normal-text">Frightening, horrible and unquiet pets from all over the world</h2>
      </div>
      <div className="box_animals" >
        { flastat.map( data => <Animal name={data.name} image= {data.image} description= {data.description} /> ) }
      </div>
    </main>
  )
}

export default Home
